import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import "../profile/profile.css";
import "./index.css";


const EditProfile = () => {
    const dispatch = useDispatch();
    const profile = useSelector(state => state.profile);
    return(
        <div className="row">
            <div className="col-12 position-relative">
                <ul className="list-group">
                    <li className="list-group-item">
                        <i className="bi bi-x-lg"></i>
                        <label className="EditProfile-label">Edit Profile</label>
                        <button className="rounded-pill btn-dark float-end editprofile-button">Save</button>
                    </li>
                    <li className="list-group-item">
                        <div className="position-relative mb-2">
                            <img src={`/images/${profile.bannerPicture}`} alt="skimag" className="w-100"/>
                            <img src={`/images/${profile.profilePicture}`} alt="skimag" className="profile-img position-absolute wd-nudge-up"/>
                        </div>
                        <div className="tuit-blank">

                        </div>
                    </li>
                    <li className="list-group-item">
                        <div className="input-group1 form-horizontal border border-secondary rounded-2 m-2">
                            <div>
                                <label for="profile-name" className="form-label px-3 mb-0 text-secondary">Name:</label>
                            </div>
                            
                            <div class="input-group">
                                <input className="form-control  ml-0 pt-0 border-0 w-25" id="profile-name" defaultValue={profile.firstName} />
                                <input className="form-control  ml-0 pt-0 border-0 w-35"  defaultValue={profile.lastName} />
                            </div>
                        </div>
                    </li>
                </ul>
            </div>
        </div>
    )
}
export default EditProfile;
